%% Code
data = valeur_excel(:,10); %colonne 10 = stress = y
single_precision_data = single(data);

[minIndices maxIndices persistence globalMinIndex globalMinValue] = run_persistence1d(single_precision_data); 

tableauXY = valeur_excel(:, 10:11);
tableauY = valeur_excel(:, 10);   %colonne 10 = stress = y
tableauX = valeur_excel(:, 11);

taille_tableauY = size(tableauY);
taille_ligne_tableauY = taille_tableauY(1,1);

taille_tableauX = size(tableauX);
taille_ligne_tableauX = taille_tableauX(1,1);


% Set a threshold for filtering resulting paired extrema
threshold = 1;

% Use logical indexing to find paired features whose persistence is bigger than threshold.
persistent_features_logical_index = persistence > threshold;  

% Now create a vector with all indices of extrema features
extremaIndices = [min(persistent_features_logical_index);
                  max(persistent_features_logical_index)];

% Or use filter_features_by_persistence to filter the pairs
persistent_features = filter_features_by_persistence(minIndices, maxIndices, persistence, threshold); 
clear extremaIndices;

extremaIndices = [persistent_features(:,1) ; persistent_features(:,2) ;];

markers = data(extremaIndices);

% Or do the same with plot_data_with_features
figure(1);
plot_data_with_features(data, [extremaIndices; globalMinIndex]);
ylabel ('Stress')

Y_rupture = max(markers); %retourne la valeur max dans extremaIndices
indice_rupture = find(tableauY == Y_rupture); %les indices dans tableauY tels que tableauY(indice_rupture) soit égal à la valeur max trouvée

%% Calcul de l'aire sous la courbe jusqu'à la rupture (méthode des trapèzes)
aire_trapeze = 0;
for k=2:indice_rupture
    largeur_trapeze = valeur_excel(k,11) - valeur_excel(k-1,11);
    hauteur1_trapeze = valeur_excel(k,10);
    hauteur2_trapeze = valeur_excel(k-1,10);
    aire_trapeze = aire_trapeze + (largeur_trapeze)*((hauteur2_trapeze + hauteur1_trapeze)/2);
end

